`,paraId:2},{value:"Then add the code below into your ",paraId:6,tocIndex:5},{value:"Vite",paraId:6,tocIndex:5},{value:" or ",paraId:6,tocIndex:5},{value:"Webpack",paraId:6,tocIndex:5},{value:" config file.",paraId:6,tocIndex:5},{value:`// vite.config.ts
